INSERT INTO `ri_pandit_details` VALUES (0,'1','7',NULL,'NEW','MA (Hindi Literature)','PERSONAL','1','0','Astrology Services,Monthly Horoscopes,Life Consulting and Remedies','Astrology Service',NULL,NULL,'2.0',NULL,NULL,NULL,NULL,NULL,NULL,'4.2','1',NULL,NULL,NULL,NULL,'20',4,NULL,'A learned and well-versed Panditji. Available for all Bengali rituals.',0),(2,'5','11',NULL,'VIP','BA (Hindi Literature)','VIDEO','1','0','Astrology Services,Monthly Horoscopes,Life Consulting and Remedies,Vashikaran Mantras,Horoscope Specialist,Know Future by DOB','Horoscope Specialist',NULL,NULL,'1.0',NULL,'[{\'Article_Name\':\'A Bud That Is Healthy Will Blossom\',\'URL\':\'\'},{\'Article_Name\':\'Love purifies you!!\',\'URL\':\'\'},{\'Article_Name\':\'Sacred Space- Who Is Corrupt?\',\'URL\':\'\'},{\'Article_Name\':\'Celebrate, Feel The Joy, Because Life Is Light\',\'URL\':\'\'},{\'Article_Name\':\'The Divine Energy To Overcome Obstacles\',\'URL\':\'\'},{\'Article_Name\':\'The Spirit Is Willing But The Flesh Is Weak\',\'URL\':\'\'},{\'Article_Name\':\'The big ‚ÄòC‚Äô of corruption\',\'URL\':\'\'},{\'Article_Name\':\'Money And Maya\',\'URL\':\'\'},{\'Article_Name\':\'Love purifies you!!\',\'URL\':\'\'},{\'Article_Name\':\'Give Room For Imperfections\',\'URL\':\'\'}]',NULL,'[{\'Image_Id\':\'37\',\'Name\':\'SAKSHAM-2016 Award\',\'Desc\':\'Most recently in the first week of November 2016, globally celebrated astrologer Pandit Ankit Sharma received another prestigious award in the field of Astrology, during a mega and momentous astrological seminar named as the Akhil Bhartiya Jyotish Sammelan - SAKSHAM. Organized by a reputed social organization of Ambala Cantt., the Jyotish Shakti Sangh, this grand event was held at BPC Jain Hall, Jagadhari Road, Ambala Cantt (Haryana) from 5th to 6th November 2016.\'},{\'Image_Id\':\'38\',\'Name\':\'Jyotish Prangan Certificate and Award\',\'Desc\':\'In October 2016, globally renowned astrologer Pandit Ankit Sharma was given the during a massive event named as URJA, which was a highly significant mega event on Astrology and Ayurveda. Held from 14th to 16th October 2016 at sector-34 of Chandigarh, URJA was organized jointly by a prestigious social organization Jyotish Prangan (located in Panchkula, Haryana), and the Planet Ayurveda. Over 100 internationally famous Astrologers, Vastu Shastra Specialists, Ayurveda Specialists, professional Psychic Readers, Tarot Card Readers, etc. pertaining to India and abroad, had actively participated in URJA.\'}]',NULL,NULL,'3.4200000000000004','1',NULL,NULL,'Abhi','2018-06-04 13:24:47','21',5,'1','This is the official profile of Sri Sri Ravi Shankar on Speaking Tree. Sri Sri is a universally revered spiritual and humanitarian leader. His vision of violence-free and stress-free society through the awakening of human values has inspired millions to broaden their spheres of responsibility and work towards the betterment of the world.',0);
